};*/

function App() {
  return (
    <div className='App'>
      <div className='App-header'>
        <BrowserRouter>
          <AuthProvider>
            <Routes>
              <Route path="/" element={<Welcome />} />
              <Route path='/signup' element={<SignUp />} />
              <Route path="/login" element={<Login />} />
              { /* <Route path="/home" element={<Home />} />
