              {/* <Route 
                path="/signup" 
                element={
                  <RedirectAuthenticated>
                    <SignUp />
                  </RedirectAuthenticated>
                } 
              /> */}

              {/* <Route 
                path="/login" 
                element={
                  <RedirectAuthenticated>
                    <Login />
                  </RedirectAuthenticated>
                } 
              /> */}

              { /*<Route path="/signup" element={<SignUp />} />
              <Route path="/login" element={<Login />} /> */}

              <Route
                path="/home"
                element={
                  <ProtectedRoute>
                    <Home />
                  </ProtectedRoute>
                }
              />

              <Route 
                path="/profile" 
                element={
                  <ProtectedRoute>
                    <Profile />
                  </ProtectedRoute>
                } 
              />
            </Routes>
          </AuthProvider>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
